css:
@-moz-document domain('terran-empire.forumieren.com'){


fieldset.fields1 div {
margin-bottom: 2px;
}

#wrap {
background-color: #262626;
}
body { background-color: #262626;background-image: none;
font-family: Verdana, Helvetica, Arial, sans-serif;
color: #828282;
font-size: 10px;

}
div#page-body div.forumbg div.inner span.corners-bottom,
div#page-body div.forumbg div.inner span.corners-bottom span {
background: #556b2f !important;



}


p.path {
clear: left;
margin-left: 1px;
margin-top: 4px;
}
a:link {
color: darkgoldenrod !important;
}

a:active {
color: darkgoldenrod !important;
}

a:visited {
color: darkgoldenrod !important;
}

a:hover {
color: goldenrod !important;
}


.row2 {
background-color:#262626;
border-color: darkgoldenrod;
border-right-style: solid;
border-right-width: 4px;
border-bottom-width: 4px;
border-bottom-style: solid;
border-left-style: solid;
border-left-width: 4px;
border-top-width:15px;
border-top-style: solid;
}

.radio {
    -webkit-appearance: none;
    background-color: #fafafa;
    border: 1px solid #cacece;
    box-shadow: 0 1px 2px rgba(0,0,0,0.05), inset 0px -15px 10px -12px rgba(0,0,0,0.05);
    padding: 7px;
    border-radius: 3px;
    display: inline-block;
    position: relative;
}

.radio:active, .radio:checked:active {
    box-shadow: 0 1px 2px rgba(0,0,0,0.05), inset 0px 1px 3px rgba(0,0,0,0.1);
}
 
.radio:checked {
    background-color: #e9ecee;
    border: 1px solid #adb8c0;
    box-shadow: 0 1px 2px rgba(0,0,0,0.05), inset 0px -15px 10px -12px rgba(0,0,0,0.05), inset 15px 10px -12px rgba(255,255,255,0.1);
    color: #99a1a7;
}
.radio:checked:after {
    content: '\2714';
    font-size: 5px;
    position: absolute;
    top: 0px;
    left: 3px;
    color: #333;
}





input.post {
	border: 1px solid #ccc;
	-moz-border-radius: 5px;
	-webkit-border-radius: 5px;
	border-radius: 5px;
	
	
	
	font-size: 11px;
	padding: 2px 5px;
	outline: 0;
	-webkit-appearance: none;
}
input.post:focus {
	border-color: #339933;
}


input.button1:hover, input.button2:hover {
background-position: 0 100%;
border: 1px solid #ccc;
	-moz-border-radius: 5px;
	-webkit-border-radius: 5px;
	border-radius: 5px;
background:#aaa;	
	
	
	font-size: 11px;
	padding: 2px 5px;
	outline: 0;
	-webkit-appearance: none;

color: #030303;
}



a.button1:hover, a.button2:hover, button.button2:hover{
background-position: 0 100%;
border: 1px solid #ccc;
	-moz-border-radius: 5px;
	-webkit-border-radius: 5px;
	border-radius: 5px;
background:#aaa;	
	
	
	
color: #030303;
}


a.button1, a.button2, button.button2, input.button1, input.button2 {
background-position: 0 100%;
border: 1px solid #ccc;
	-moz-border-radius: 5px;
	-webkit-border-radius: 5px;
	border-radius: 5px;
	
	
	
	font-size: 11px;
	padding: 2px 5px;
	outline: 0;
	-webkit-appearance: none;
background-color: #B65700;
color: #030303;
}





.inputbox {
background-color: #141414;
border: 1px solid #aaa;
color: #bbb;
cursor: text;
padding: 2px;
}
.inputbox:hover {
border: 1px solid #B65700;
}
.content {
min-height: 3em;
overflow: hidden;
line-height: 1.4em;
font-family: "Lucida Grande", "Trebuchet MS", Verdana, Helvetica, Arial, sans-serif;

padding-bottom: 1px;
color: #828282;
}
.row1 {
background-color:#262626;

border-color: darkgoldenrod;
border-right-style: solid;
border-right-width: 4px;
border-bottom-width: 4px;
border-bottom-style: solid;
border-left-style: solid;
border-left-width: 4px;
border-top-width:15px;
border-top-style: solid;
}

#message-box textarea {
color: #bbb;
font-family: Verdana,Arial,Helvetica,sans-serif;
font-size: 1.2em;

}

.panel {
background-color: #262626;
color: #828282;
margin-bottom: 4px;
padding: 0 10px;
}

.navbar {
background-color: #262626;
}
.h3, h3 {
border-bottom: 1px solid gray;
color: #262626;
font-family: Verdana,Arial,Helvetica,sans-serif;
font-size: 1.05em;
margin-bottom: 3px;
margin-top: 20px;
padding-bottom: 2px;
text-transform: uppercase;
}
.headerbar {
background-color: #262626;
background-image: none;
background-repeat: repeat-x;
margin-bottom: 4px;
padding: 0 5px;
}

.forabg {
background-color: #222;
background-image: url(http://illiweb.com/fa/empty.gif);
background-position: 0 0;
background-repeat: repeat-x;
border: 2px solid #333;
clear: both;
margin-bottom: 4px;
padding: 0 5px;
}
li.row {
background-color: #262626;
border-bottom: 0px solid #262626;
border-top: 0px solid #262626;
}
li.row:hover{
background-color: #262626;
}

div#page-body div.forumbg div.inner span.corners-bottom, div#page-body div.forumbg div.inner span.corners-bottom span {
background: darkgoldenrod !important;
}
.forumbg {
background-color: darkgoldenrod !important;
background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAABcCAYAAACm7n/aAAAAAXNSR0IArs4c6QAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9wJBxQaCesxZe8AAAAkSURBVDjLY9zRxv2fAQ0wMWABo4KjgqOCo4KjgqOCo4K0EAQA8HgDAOTy8v0AAAAASUVORK5CYII=) !important;
background-position: 0 0;
background-repeat: repeat-x;
border: 2px solid #111;
clear: both;
margin-bottom: 4px;
padding: 0 5px;
}

.ul{background-color:#999;}
.ul:hover{background-color:#262626;}
ul.topiclist {
color: #828282;
list-style-type: none;
}


blockquote {
background: darkgoldenrod  url(http://illiweb.com/fa/prosilver/quote.gif) 6px 8px no-repeat;
border: 1px solid #grey;
font-size: .95em;
color: #111;
margin: 1em 1px 1em 25px;
overflow: hidden;
padding: 5px;
}
.content blockquote {
color: #111;
}


fieldset dl dt label {
color: #262626;
}

fieldset dl:hover dt label {
color: #B65700;
color: darkgoldenrod;
}


a.button1:hover, a.button2:hover, button.button2:hover, input.button1:hover, input.button2:hover {
background-position: 0 100%;
border: 1px solid #FCFCFC;
color: #030303;
}


/*profile*/
.postprofile {
border-color: darkgoldenrod;
border-right-style: solid;
border-right-width: 1px;
color: #828282 !important;
display: inline;
float: left;
margin: 5px 0 0;
min-height: 80px;
position: relative;
width: 22%;
}

img[src*="i_post.png"] {
width: 100px !important;
height: 25px !important;
content: url(data:image/png;base64,) no-repeat !important;}






img[src*="i_reply.png"] {
width: 100px !important;
height: 25px !important;
content: url(data:image/png;base64,) no-repeat !important;}

}
